import React, { useState, useEffect } from 'react';
import 'react-table/css/react-table.css'; // Importe os estilos do React-Table
import { AiOutlineEdit, AiOutlineDelete } from 'react-icons/ai';

const OrdensDeServico = () => {
  const [ordensDeServico, setOrdensDeServico] = useState([]);

  const columns = [
    {
      Header: 'Número',
      accessor: 'numero',
    },
    {
      Header: 'Título',
      accessor: 'titulo',
    },
    {
      Header: 'Descrição',
      accessor: 'descricao',
    },
    {
      Header: 'Prioridade',
      accessor: 'prioridade',
    },
    {
      Header: 'Responsável',
      accessor: 'responsavel_id',
    },
    {
      Header: 'Data de início',
      accessor: 'data_inicio',
    },
    {
      Header: 'Data de término',
      accessor: 'data_fim',
    },
    {
      Header: 'Status',
      accessor: 'status',
    },
    {
      Header: 'Ações',
      Cell: ({ row }) => (
        <div>
          <button>
            <AiOutlineEdit /> Editar
          </button>
          <button>
            <AiOutlineDelete /> Excluir
          </button>
        </div>
      ),
    },
  ];

  const fetchData = async () => {
    const response = await fetch('http://localhost:8000/api/ordem-servico');
    const data = await response.json();

    setOrdensDeServico(data);
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div>
      <h1>Lista de Ordens de Serviço</h1>
      <ReactTable data={ordensDeServico} columns={columns} />
    </div>
  );
};

export default OrdensDeServico;
